import React from "react";
import OrderDetail from "../../component/OrderDetail/OrderDetail";
import "./CompletedOrder.scss";
import { Link } from 'react-router-dom';
import { Button } from '@material-ui/core';
import { useHistory } from 'react-router-dom';

function CompletedOrder() {
  const date = new Date()
  const today = `${date.getDate()}/${date.getMonth()}/${date.getFullYear()}`;
  const cartInfoSection = JSON.parse(sessionStorage.getItem("item_cart"));
  const finalInfoMap = {
    idOrder: cartInfoSection.id,
    orderDate: today,
    payMethod: cartInfoSection.paymentMethod.title,
    listProduct: cartInfoSection.cartList,
    intoMoney: cartInfoSection.totalPay,
  };
  const history = useHistory();
  return (
    <div className="ContainerCompletedOrder">
      <OrderDetail orderDetail={finalInfoMap} />
        <div className="ButtonSend">
          <Button className="ButtonLeft" onClick={() => history.push('')}>
            Tiếp tục mua hàng
          </Button>
          <Button className="ButtonRight">
            <Link to={'/my-order'} className="Link">
             Đơn hàng của tôi
            </Link>
          </Button>
        </div>
    </div>
  );
}

export default CompletedOrder;
